import React, { Component } from 'react';
import { stats, config } from '../services/icons';

class Header extends Component {
  render() {
    return (
      <header>
        <button type="button" id="help">?</button>
        <h1>Try Word</h1>
        <button type="button" id="stats">{stats()}</button>
        <button type="button" id="help">{config()}</button>
      </header>
    );
  }
}

export default Header;
